import React from 'react'
import ContactDropDown from './contactDropDown'
import './topBar.css'


export default function TopBar(props)
{
    return(
        <div className="navbar has-shadow is-fixed-top">

            <div className="navbar-brand">
            <div className="image navbar-item is-128by48">
                <img alt="logo" src={props.logoUrl} className=""/>
            </div>


                <h1 className="navbar-item title is-1" id="title">{props.name}</h1>



            <div className="navbar-menu">
                {
                    Object.keys(props.social).map(site => {
                      return(
                        <div className="column">
                            <a href={props.social[site]} className="navbar-item">{site}</a>
                        </div>  
                      )
                    })
                }
            </div>
            </div>
        </div>
    )
}
